	if ( @{ $_[ARGS] } > 1 ) {
		my $last = pop(@bytes) || 0;			# last byte
		
		my $binop = $_[ARGS][1][0][TYPE];		# operator
		my $expr =  $_[ARGS][1][1]->build("$last $binop {}");
		
		return [ @bytes, $expr ];					
	}
	else {
		return \@bytes;
	}
}
