sub _action_21 {
	my $name = $_[ARGS][0][VALUE];
	if ( @{$_[ARGS]} > 1 ) {	# NAME = expr
		my $expr = $_[ARGS][1];
		$_[PROG]->symbols->{$name} = $expr;
	}
	else {						# NAME label
