		my $opcode = CPU::Z80::Assembler::Opcode->new(
							child 	=> [],
							line	=> $_[ARGS][0][LINE]);
		$_[PROG]->add($opcode);
		$_[PROG]->symbols->{$name} = $opcode;
	}
	undef;
}
