#------------------------------------------------------------------------------

=head2 parse

  $result = parse($input, $user, $start_rule)

This function receives the input token stream, a user pointer and an optional
start rule number. 

It parses the input stream, leaving the stream at the first unparsed
token, and returns the parse value - 
the result of the action function for the start rule.

The function dies with an error message indicating the input that cannot be parsed in 
case of a parse error.

$input is a stream of tokens, each token is an array reference with 
[TYPE, VALUE, LINE] : the token type, the token value and the input source line
where the token was read.

Each LINE is an array reference with [TEXT, LINE_NR, FILE] : the text of the 
whole input source line, the line number and the source file name. The 
LINE is used at error messages.

$user is a user pointer that is passed back at each action function.

$start_rule is an optional alternative start rule ID.

=cut

#------------------------------------------------------------------------------

sub parse {
	my($input, $user, $start_rule) = @_;

	# current state
	my $state;
	if (defined($start_rule)) {
		$state = $state_table[0]{$start_rule}
					or croak "rule '$start_rule' not found";
	}
	else {
		$state = $start_state
					or croak "start state not found";
	}
	my @values = ();
	
	# return stack of states
	my @stack = ();					# store: [$state, @values]

	# fetch token only after drop and after calling parser rules
	my $token = head($input);
	for(;;) {
		my($entry, $found_else);
		if ($entry =  $state_table[$state]{($token ? $token->[TYPE] : "")}) {
			# entry exists, found token
		}
		elsif ($entry = $state_table[$state]{__else__}) {
			$found_else++;
		}
		else {
			_expected_error_at($token, $state);
		}
		
		if (ref($entry) eq 'ARRAY') {					# call sub-rule
			my($next_state, $return_state) = @$entry;
			push(@stack, [ $return_state, @values ]);	# return data
			($state, @values) = ($next_state);			# call
		}
		else {											# accept token
			$state = $entry;
			
			if (!$found_else) {
				push(@values, $token) if $token;		# add token to values
				drop($input);							# and get next token
				$token = head($input);
			}

			while (ref($state) eq 'CODE') {				# return from sub-rules 
				my $value = eval { $state->([@values], $user, $input) };
				$@ and error_at($token, "Parse error, $@");
				$token = head($input);					# in case $input was changed

				if ( ! @stack ) {						# END OF PARSE
					$_[0] = $input;						# advance input
					return $value;
				}
				
				my $top = pop(@stack);
				($state, @values) = @$top;
				push(@values, $value) if defined($value);
			}
		}
	}
}

#------------------------------------------------------------------------------

=head2 error_at

  error_at($token, $message)

Dies with the given error message, indicating the place in the input source file
where the error occured, i.e. the position of the given token.

=cut

#------------------------------------------------------------------------------

sub error_at { 
	my($token, $message) = @_;
	die _error_message($token, "Error", $message);
}

#------------------------------------------------------------------------------

=head2 warning_at

  warning_at($token, $message)

Warns with the given error message, indicating the place in the input source file
where the error occured, i.e. the position of the given token. 

=cut

sub warning_at { 
	my($token, $message) = @_;
	warn _error_message($token, "Warning", $message);
}

#------------------------------------------------------------------------------
# error message for error_at() and warning_at()
sub _error_message { 
	my($token, $type, $message) = @_;
	
	$message ||= ""; chomp($message);
	my $file_pos = ($token && $token->[LINE]) ? 
					($token->[LINE][FILE] || "input")." ".($token->[LINE][LINE_NR] || "").": " :
					"";
	my $line_pos = " at "._format_token($token ? $token->[TYPE] : "");
	
	return $file_pos.$type.": ".$message.$line_pos."\n";
}

#------------------------------------------------------------------------------
# expected error
sub _expected_error_at { 
	my($token, $state) = @_;
	
	my @expected = sort map {_format_token($_)} keys %{$state_table[$state]};	
	error_at($token, 
			"Parse error, expected ".
			(scalar(@expected) == 1 ? "@expected" : "one of (@expected)"));
}

#------------------------------------------------------------------------------
# format a token 
sub _format_token {
	my($token) = @_;
	return "EOF" if $token eq "";
	return dump($token) if $token =~ /\W/;
	return $token;
}



sub z80parser { parse(@_) }

#------------------------------------------------------------------------------
# add opcode
sub _add_opcode {
	my($args, $program, $input, @bytes) = @_;
	if (@bytes) {
		my $opcode = CPU::Z80::Assembler::Opcode->new(
									child 	=> \@bytes,
									line	=> $args->[0][LINE]);
		$program->add($opcode);
	}
	return undef;
}

